.el-header,
.el-footer {
  background-color: #b3c0d1;
  position: fixed;
  width: 100%;
}
.el-header {
  top: 0;
}
.el-footer {
  bottom: 0;
}
.el-aside {
}

.el-main {
  background-color: #e9eef3;
  position: fixed;
  width: 100%;
  height: calc(100% - 120px);
  top: 60px;
}

// 搜索框

.el-input {
  width: calc(100% - 200px);
  margin-left: 100px;
  margin-top: 14px;
}

.block {
  position: absolute;
  top: 10px;
}

.el-input__icon {
  width: 100%;
}
// 注销
.register {
  position: absolute;
  right: 20px;
  top: 14px;
}
.el-col {
  overflow: hidden;
  float: left;
}
